#include <fstream>
#include <string>
using namespace std;

ifstream fin;
ofstream fout;
long long n;

string ss, ta;

void zip();

void b_a()
{
    fout << "pp.p.p..." << endl;
    fout << "p.p..." << endl;
    fout << "pp.p.p...p.p.." << endl;
    for (int i = 0; i < ss.length(); i++)
    {
        if (ss[i] == 'a')
        {
            for (int j = 0; j < 3; j++)
                ta.push_back('q');
        }
        else if (ss[i] == 't')
        {
            for (int j = 0; j < 4; j++)
                ta.push_back('q');
        }
        else
            ta.insert(ta.end(), ss[i]);
    }
    for (int i = 0; i < ta.length(); i++)
    {
        if (ta[i] == 'q')
        {
            for (int j = 0; j < 15; j++)
                fout << '.';
        }
        else if (ta[i] == 'r')
        {
            for (int j = 0; j < 7; j++)
                fout << '.';
        }
        else if (ta[i] == 'n')
        {
            for (int j = 0; j < 4; j++)
                fout << '.';
        }
        else if (ta[i] == 'm')
        {
            for (int j = 0; j < 2; j++)
                fout << '.';
        }
        else
            fout << ta[i];
    }
}

int main()
{
    fin.open("software.in");
    fout.open("software.out");
    
    string ss;
    fin >> ss;
    fin >> n;

    zip();

	b_a();
    
    fin.clear();
    fout.clear();
    fin.close();
    fout.close();
    
    return 0;
}

